import "bootstrap/dist/css/bootstrap.min.css";
// import "./pages/Admin.css"
import { createContext, useEffect, useState } from "react";
import Login from "./components/Auth/Login";
import SignUp from "./components/Auth/SignUp";
import "react-toastify/dist/ReactToastify.css";
// import api, { checkTokenExpiration, refreshAccessToken } from "./api/api";
import { BrowserRouter, Route,Routes, Switch,Navigate } from "react-router-dom";
import AdminPage from "./pages/AdminPage";
import UserPage from "./pages/UserPage";
import NotFound from "./pages/NotFound";

// const MyContext = createContext();

function App() {



  return (
    <BrowserRouter>

      <Routes>
        <Route path={`/login`} element={ <Login /> } />
        <Route path={`/signUp`} element={ <SignUp /> } />
        {/* <Route path="/dashboard" element={isLogin && shop && accessToken && isOnline ? <AdminPage /> : <Navigate to="/login" />} /> */}
        <Route path="/admin/*" element={ <AdminPage /> } />
        <Route path="/user/*" element={<UserPage />} />
        <Route path="/" element={<Navigate to="/user/home" replace />} />
        <Route path="*" element={<NotFound />} />
      </Routes>

    </BrowserRouter>
  );
}

export default App;
